static rt_ai_t model = NULL;

void ai_run_complete(void *arg){
    *(int*)arg = 1;
}

int cld_app(void){
    lcd_show_image(0, 0, 320, 240, LOGO);
    lcd_show_string(90, 140, 16, "Hello RT-Thread!");
    lcd_show_string(90, 156, 16, "Demo: Corn Leaf Disease Detection");
    rt_thread_mdelay(1000);
    lcd_clear(BLACK);

    rt_err_t result = RT_EOK;
    int ai_run_complete_flag = 0;

    rt_ai_buffer_t *work_buffer = rt_malloc(RT_AI_CLD_WORK_BUFFER_BYTES+RT_AI_CLD_IN_TOTAL_SIZE_BYTES+RT_AI_CLD_OUT_TOTAL_SIZE_BYTES);

    //find a registered model handle
    model = rt_ai_find(RT_AI_CLD_MODEL_NAME);
    if(model == RT_AI_NULL){
        return -1;
    }
    //init the model handle
    result = rt_ai_init(model, work_buffer);
    if(result != 0){
        return -1;
    }

    //prepare input data
    rt_memcpy(model->input[0], input_data0, RT_AI_CLD_IN_1_SIZE_BYTES);
    result = rt_ai_run(model, ai_run_complete, &ai_run_complete_flag);

    //process the inference data
    if(ai_run_complete_flag){
        //get inference data
        uint8_t *out = (uint8_t *)rt_ai_output(model, 0);
        //get argmax
        int max_index = 0;
        for(int i = 1 ; i < 4 ; i++){
             if(out[i] > out[max_index]){
                 max_index = i;
             }
        }

        rt_kprintf("CLD prediction: %s\n", corn_label[max_index]);
        lcd_show_image(0, 0, 320, 240, SMALLSPOT0);
        lcd_show_string(10, 172, 16, "CLD model prediction:");
        lcd_show_string(210, 172, 16, corn_label[max_index]);
        // AI_LOG("Prediction: %d\n", prediction);
    }
    rt_free(work_buffer);
    return 0;
}
